def decode(codes, encoded):
    huff = {'000010': '[newline]', '000011': '(', '000100': ')', '000101': '3', '000110': ':', '000111': 'G', '001000': 'K', '001001': 'U', '001010': '[', '001011': ']', '001100': 'x', '001101': '4', '001110': '7', '001111': 'D', '010000': 'F', '010001': 'J', '010010': 'R', '010011': '8', '010100': 'O', '010101': 'k', '010110': '5', '010111': '6', '011000': 'B', '011001': 'M', '011010': 'N', '011011': 'T', '011100': 'W', '011101': "'", '011110': '0', '011111': '9', '100000': 'C', '100001': '-', '100010': '2', '100011': 'P', '100100': 'E', '100101': '1', '100110': 'I', '100111': 'A', '101000': 'b', '101001': '.', '101010': 'w', '101011': 'v', '101100': 'S', '101101': ',', '101110': 'y', '101111': 'u', '110000': 'g', '110001': 'f', '110010': 'm', '110011': 'c', '110100': 'p', '110101': 'd', '110110': 'h', '110111': 'l', '111000': 's', '111001': 'r', '111010': 'o', '111011': 'a', '111100': 't', '111101': 'n', '111110': 'i', '111111': 'e', '00000': ' '}
    
    res = ""
    size = len(encoded)
    
    i = 0
    while i < size-5:
        j = 1
        while 1:
            try:
                s = huff[encoded[i:i+j]]
                i += j
                break
            except:
                j += 1
                continue

        if s == "[newline]":
            res += '\n'
        else:
            res += s
    return res



